    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE - 69 NOT IN ( + + col0 / col0 + - col2 ) AND - col2 NOT BETWEEN col0 AND col2;
  - name: tab1

outputs:
  - name: q393.out
    data: |
      51	14	96
      85	5	59
      91	47	68
